import React, {Component} from 'react';

class NavBar extends Component{
	state = {
		styles:{
			width:1920,
			height:50,
			backgroundColor:'grey',
		},
	}

	render(){
		return(
			<div style={this.state.styles} className="navbar">
				<h1></h1>
			</div>
		);
	}
}

export default NavBar;
